import './App.css';
import React from "react";
import header from './header';
import footer from './footer';
import content from './content';
import sidebar from './sidebar';
import menu from './menu';

function App() {
  return (
    <div className="App">
    <div><header/></div>
    <div><menu/></div>
    <div><content/></div>
    <div><sidebar/></div>
    <div><footer/></div>
    </div>
  );
}

export default App;
